import React from "react";
import { TableStyled, TheadStyled } from "./TransactionHistory.styled";

const TransactionHistory = ({ transactions }) => {
  const { id, type, amount, currency } = transactions;
  return (
    <TableStyled>
      <TheadStyled>
        <tr>
          <th>Type</th>
          <th>Amount</th>
          <th>Currency</th>
        </tr>
      </TheadStyled>
      <tbody>
        {transactions.map((i) => {
          return (
            <tr key={i.id}>
              <td>{i.type}</td>
              <td>{i.amount}</td>
              <td>{i.currency}</td>
            </tr>
          );
        })}
      </tbody>
    </TableStyled>
  );
};

export default TransactionHistory;
